import React from 'react';
import Data from './Data'
import Card from './Cards'

const Amazon = () => {
    return(
        <Card
        key= {Data[3].id}
        imgsrc={Data[3].imgsrc}
        sname={Data[3].sname}
        title={Data[3].title}
        link={Data[3].link}
        />
      )
}

export default Amazon;
